import React, { useState, useEffect } from 'react'
import axios from 'axios'

function DataFetching() {
	const [post, setPost] = useState({})

	useEffect(() => {
		axios
			.get(`http://api.openweathermap.org/data/2.5/weather?q=Lyon&appid=8c2dbdca747ed150544b60e2ae60fbf1`)
			.then(res => {
        console.log(res)
        setPost(res.data)
			})
			.catch(err => {
				console.log(err)
			})
	}, [])


	return (
		<div>
            <ul>
                {post.map(post => (
                    <li key={post.id}>{post.title}</li>
                ))}
            </ul>
		</div>
	)
}

export default DataFetching
